import React from "react";
import { ReactTyped as Typed } from "react-typed";

const TypingEffect = () => {
  return (
    <Typed
      strings={["Desenvolvedor Front end"]}
      typeSpeed={50}
      showCursor={false}
    />
  );
};

export default TypingEffect;
